import React from 'react';
import mujerSAC from "../public/assets/svg/mujersac.svg"
import ampolleta from "../public/assets/svg/ampolleta.svg";


export default function Resultado (){
    const headers = {
        "Content-Type": "application/json"
    };

    if (typeof window !== "undefined") {
        console.log()

        let body_eventos = {
            Sesion_id: localStorage.getItem("sessionId"),
            Evento_id: 2,
            Result_0: parseInt(localStorage.getItem("sueldoAnual")),
            Result_1: 0,
            Result_2: 0,
            Rut: localStorage.getItem("rut")
        }
    }

    function contactarme() {
        body_eventos.Evento_id = 2;
        axios
            .post('Eventos', body_eventos, { headers: headers })
            .then((response) => {
                let data = response.data;

                if (data.resultado) {
                    window.location.href = "/solicitud";
                }
            })
            .catch(e => {
                console.log(e);
            });
    }

    const dudas_texto =
        "Nuestros ejecutivos pueden asesorarte en línea o vía teléfonica. Queremos ayudarte a resolver todas tus inquietudes o darte todas las opciones para tu traspaso.";

    return (
        <section>
        <div className="resultado">
            <div className="row">
                <div className="col-md-8 mx-auto desktop flex-column">
                    <img src={ampolleta} alt="pareja modelo" />
                    <h1>¿Por qué abrir un APV?</h1>
                    <p>El APV te permite complementar tus ahorros y/o compensar períodos no cotizados, para mejorar tu pensión. Dependiendo del régimen tributario que elijas podrás recibir un aporte fiscal o rebajar lo ahorrado de tu renta tributable.</p>
                </div>
            </div>
            <div className="row w-100 container-padre dudas">
                <img src={mujerSAC} alt="Dudas" />
                <div className="txtDesktop parrafo2">
                    <div className="container-title">
                        <h5>¿Aún tienes dudas?</h5>
                        <p>{dudas_texto}</p>
                        <button
                            type="button"
                            className="btn blue btn-lg btn-block"
                            onClick={contactarme}
                            id="ejecutivo"
                        >
                            Quiero que me contacten
                        </button>
                    </div>
                </div>
            </div>
        </div>
        </section>
    );
}
